import P10 from "../../SourceFiles/Work/Photography/p10.jpg";
import FlexBox from "../FlexBox";
import Button from "../Button";

function OurLastestWork() {
  const [operation, setoperation] = useState({
    name: "Design",
  });

  const [Data, setData] = useState([
    {
      name: "Photography",
      funk : 'OperationPhoto',
      data: [
        {
          id: 1,
          img: P1,
          name: "T",
        },
        {
          id: 2,
