          name: "Y",
        },
        {
          id: 2,
          img: P8,
          name: "O",
        },
        {
          id: 2,
          img: P9,
          name: "U",
        },
        {
          id: 2,
          img: P10,
          name: " ",
        },
      ],
    },
    {
      name: "Design",
      funk : 'OperationDesign',
      data: [
        {
          id: 1,
          img: P2,
          name: "T",
        },
        {
          id: 2,
          img: P1,
          name: "H",
        },
        {
          id: 3,
