          name: "K",
        },
        {
          id: 2,
          img: P7,
          name: " ",
        },
        {
          id: 2,
          img: P8,
          name: "Y",
        },
        {
          id: 2,
          img: P6,
          name: "O",
        },
        {
          id: 2,
          img: P10,
          name: "U",
        },
        {
          id: 2,
          img: P3,
          name: " ",
        },
      ],
    },
    {
      name: "Print",

      data: [
        {
          id: 1,
          img: P10,
          name: "T",
        },
        {
          id: 2,
          img: P8,
          name: "H",
        },
        {
          id: 3,
          img: P7,
          name: "A",
        },
        {
          id: 2,
